                            onChange={this.handleDropDownViewChange}
                            list={dropDownFilterList}
                            value={dropDownFilterValue}
                        />
                        {/*<SearchBar*/}
                        {/*    searchBarType={'default'}*/}
                        {/*    sort={false}*/}
                        {/*    filter={false}*/}
                        {/*/>*/}
                    </div>
                </div>
                <div className="table-container">
                    <MyTable
                        Headers={header}
                        Data={dataPerPage}
                        autoHeight={true}
                        cellHeight="100%"
                        noShadow={true}
                    />
                    <br />
                    <Pagination
                        paginationType={'both'}
                        noOfPages={totalPage}
                        onChangePage={this.handlePageChange}
                        currentPage={currentPage}
                        pageItemsLimit={perPage}
                    />
                </div>
            </div>
        )
    }
}

